import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import ShopInStore from './components/shopInStore'; // Corrected component import path
import Products from './components/product';
import Home from './components/home';
import OrderOnline from './components/orders'; // Corrected component import path
import AboutUs from './components/about';
import Account from './components/login';
import Dashboard from './components/dashboard'; // Import Dashboard component
import Footer from './components/footer';
import backgroundImg from './background.PNG';

// Contact component content (replace with actual content as needed)
const ContactContent = () => (
  <div>
    <h2>Contact Us</h2>
    <p>Feel free to reach out to us at contact@example.com or visit our store.</p>
  </div>
);

function App() {
  return (
    <Router>
      <div className="App" style={{ backgroundImage: `url(${backgroundImg})` }}>
        <header>
          <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/about">About</Link></li>
              <li><Link to="/products">Products</Link></li>
              {/* Remove Contact link from the navigation */}
              <li><Link to="/account">Account</Link></li>
              <li><Link to="/order-online">Order Online</Link></li>
              <li><Link to="/dashboard">Dashboard</Link></li>
            </ul>
          </nav>
        </header>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<AboutUs />}>
            {/* Render Contact content inside AboutUs component */}
            <Route path="contacts" element={<ContactContent />} />
          </Route>
          <Route path="/products" element={<Products />} />
          {/* Remove Route for /contacts */}
          <Route path="/account" element={<Account />} />
          <Route path="/order-online" element={<OrderOnline />}>
            <Route path="shop-in-store" element={<ShopInStore />} />
          </Route>
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>

        <Footer />
      </div>
    </Router>
  );
}

export default App;
